pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "./ERC721Mintable.sol";
import "./verifier.sol";

// TODO define a contract call to the zokrates generated solidity contract <Verifier> or <renamedVerifier>

// TODO define another contract named SolnSquareVerifier that inherits from your ERC721Mintable class
contract SolnSquareVerifier is CustomERC721Token, Verifier {
  using Counters for Counters.Counter;
  // TODO define a solutions struct that can hold an index & an address
  struct Solution {
    bytes32 index;
    address caller;
  }
  Counters.Counter tokenId;
  // TODO define an array of the above struct
  Solution[] solutions;
  // TODO define a mapping to store unique solutions submitted
  mapping(address => Solution) uniqSolutions;
  // TODO Create an event to emit when a solution is added
  event SolutionAdded(bytes32 indexed index, address indexed caller);

  modifier solutionIsUniq(bytes32 input, address caller) {
    require(uniqSolutions[caller].index != input, "proof already submitted");
    _;
  }

  // TODO Create a function to add the solutions to the array and emit the event
  function add(bytes32 _index, address _caller) public {
    Solution memory _solution = Solution({ index: _index, caller: _caller });
    solutions.push(_solution);
    uniqSolutions[_caller] = _solution;
    emit SolutionAdded(_index, _caller);
  }

  // TODO Create a function to mint new NFT only after the solution has been verified
  //  - make sure the solution is unique (has not been used before)
  //  - make sure you handle metadata as well as tokenSuplly

  function mintToken(Proof memory proof, uint256[2] memory input)
    public
    solutionIsUniq(keccak256(abi.encode(proof)), msg.sender)
  {
    bool _check = verifyTx(proof, input);
    require(_check, "proof must be valid");
    this.add(keccak256(abi.encode(proof)), msg.sender);
    mint(msg.sender, tokenId.current());
    tokenId.increment();
  }
}
